import React from "react";

/**Import core component (variable)*/
import Select from "../../core/Select";
import { TOP_100_FILMS } from "./films";

export const DEMO = ({
  view,
  color,
  icon,
  dense,
  fill,
  disabled,
  filterable,
  matchTargetWidth
}) => {
  return (
    <Select
      view={view}
      color={color}
      dense={dense}
      icon={icon === true ? "film" : null}
      fill={fill}
      centerAlign={true}
      filterable={filterable}
      disabled={disabled}
      matchTargetWidth={matchTargetWidth}
      items={TOP_100_FILMS}
    />
  );
};
